The input params table can have any key desired by the user, but they must be tables. These tables can be empty or can contain the following keys: hint, string . A hint to the user when prompted to provide a value. [input_params]
host = { hint = "The host of the API" }
id.hint = "The ID of the resource" To know how the input parameters are used, refer to the input parameters page .
